import React from 'react';
import AppLayout from '../components/AppLayout'
import SignOutForm from '../components/SignUpForm'

const SignUp = () => {
    return (
        <AppLayout>
            <SignOutForm/>
        </AppLayout>
    );
};


export default SignUp;
